class AffiliateBeautifier{constructor(t){this.o=Object.assign({},this.defaults(),t),document.addEventListener("DOMContentLoaded",()=>{this.switchAll(),this.eventClick()})}defaults(){return{selector:"[data-href]"}}eventClick(){["mousedown","touchstart"].forEach(t=>{document.querySelectorAll(this.o.selector).forEach(e=>{e.addEventListener(t,t=>{this.switch(t.target)})})})}switchAll(){document.querySelectorAll(this.o.selector).forEach(t=>{this.switch(t)})}switch(t){let e=t.getAttribute("href"),i=t.dataset.href;t.setAttribute("href",i),t.dataset.href=e}}function affiliateBeautifier(t){new AffiliateBeautifier(t)}